@writer.new_font(font)
@writer.send_line_break()
@writer.send_flowing_data("In Tierstudien hat sich Ganciclovir als mutagen, teratogen, aspermatogen und karzinogen erwiesen.")
@writer.send_line_break()
@writer.send_flowing_data("Valcyte ist deshalb beim Menschen als potenziell teratogene und karzinogene Substanz anzusehen,")
@writer.send_line_break()
@writer.send_flowing_data("die m\366glicherweise Geburtsdefekte und Krebserkrankungen verursachen kann (siehe \253Pr\344klinische")
@writer.send_line_break()
@writer.send_flowing_data("Daten\273). Es ist auch wahrscheinlich, dass Valcyte eine vor\374bergehende oder dauernde Hemmung")
@writer.send_line_break()
@writer.send_flowing_data("der Spermatogenese verursachen kann (siehe \253Schwangerschaft/Stillzeit\273, \253Unerw\374nschte")
@writer.send_line_break()
@writer.send_flowing_data("Wirkungen\273 und \253Pr\344klinische Daten\273).")
@writer.send_line_break()
@writer.send_flowing_data("Frauen im geb\344rf\344higen Alter m\374ssen darauf hingewiesen werden, w\344hrend der Behandlung")
@writer.send_line_break()
@writer.send_flowing_data("wirksame Empf\344ngnisverh\374tungsmassnahmen zu treffen. M\344nner m\374ssen darauf hingewiesen")
@writer.send_line_break()
@writer.send_flowing_data("werden, w\344hrend der Behandlung mit Valcyte und f\374r mindestens 90 Tage danach")
@writer.send_line_break()
@writer.send_flowing_data("Empf\344ngnisverh\374tungsmassnahmen mit Barrierewirkung zu treffen (siehe \253Pr\344klinische Daten\273).")
@writer.send_line_break()
@writer.send_flowing_data("Bei mit Valcyte (und Ganciclovir) behandelten Patienten wurde eine schwere Leukopenie,")
@writer.send_line_break()
@writer.send_flowing_data("Neutropenie, An\344mie, Thrombozytopenie, Panzytopenie, Knochenmarkdepression und aplastische")
@writer.send_line_break()
@writer.send_flowing_data("An\344mie beobachtet. Eine Therapie sollte nicht eingeleitet werden, wenn die absolute")
@writer.send_line_break()
@writer.send_flowing_data("Neutrophilenzahl unter 500 Zellen/\265l oder die Thrombozytenzahl unter 25'000/\265l oder der")
@writer.send_line_break()
@writer.send_flowing_data("H\344moglobinspiegel unter 8 g/dl liegt (siehe \253Dosierung/Anwendung\273 und \253Unerw\374nschte")
@writer.send_line_break()
@writer.send_flowing_data("Wirkungen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Die Anwendung von Valcyte bei Kindern wird nicht empfohlen (siehe \253Dosierung/Anwendung\273).")
@writer.send_line_break()
@writer.send_flowing_data("Die Bioverf\374gbarkeit von Ganciclovir aus Valcyte ist um das 10fache h\366her als aus Ganciclovir")
@writer.send_line_break()
@writer.send_flowing_data("Kapseln (Cymevene). Ganciclovir Kapseln d\374rfen nicht in einem Verh\344ltnis von eins zu eins durch")
@writer.send_line_break()
@writer.send_flowing_data("Valcyte ersetzt werden. Patienten, die von Ganciclovir Kapseln auf Valcyte umgestellt werden, sollten")
@writer.send_line_break()
@writer.send_flowing_data("darauf hingewiesen werden, dass ein Risiko einer \334berdosierung besteht, wenn sie mehr als die")
@writer.send_line_break()
@writer.send_flowing_data("verordnete Zahl Valcyte Tabletten einnehmen (siehe \253Dosierung/Anwendung\273 und")
@writer.send_line_break()
@writer.send_flowing_data("\253\334berdosierung\273).")
@writer.send_line_break()
@writer.send_flowing_data("Es wird empfohlen, w\344hrend der Therapie das grosse Blutbild und die Thrombozytenzahl zu")
@writer.send_line_break()
@writer.send_flowing_data("\374berwachen. Bei Patienten mit schwerer Leukopenie, Neutropenie, An\344mie und/oder")
@writer.send_line_break()
@writer.send_flowing_data("Thrombozytopenie wird empfohlen, eine Behandlung mit h\344matopoietischen Wachstumsfaktoren")
@writer.send_line_break()
@writer.send_flowing_data("und/oder eine Unterbrechung der Behandlung zu erw\344gen (siehe \253Dosierung/Anwendung\273 und")
@writer.send_line_break()
@writer.send_flowing_data("\253Unerw\374nschte Wirkungen\273).")
@writer.send_line_break()
