@writer.send_paragraph()
@writer.send_flowing_data("Bei Patienten mit eingeschr\344nkter Nierenfunktion ist in Abh\344ngigkeit von der Kreatininclearance eine")
@writer.send_line_break()
@writer.send_flowing_data("Dosisanpassung erforderlich (siehe \253Dosierung/Anwendung\273 und \253Kinetik spezieller")
@writer.send_line_break()
@writer.send_flowing_data("Patientengruppen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Bei Dialysepatienten (CrCl <10 ml/min) wird empfohlen, intraven\366ses Ganciclovir (anstatt Valcyte)")
@writer.send_line_break()
@writer.send_flowing_data("zu verwenden. Es wird nach dem in der g\374ltigen Fachinformation f\374r intraven\366ses Ganciclovir")
@writer.send_line_break()
@writer.send_flowing_data("angegebenen Schema zur Dosisreduzierung dosiert (siehe \253Dosierung/Anwendung\273 und \253Kinetik")
@writer.send_line_break()
@writer.send_flowing_data("spezieller Patientengruppen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Bei Patienten, die Imipenem-Cilastatin und Ganciclovir einnehmen, wurden Krampfanf\344lle")
@writer.send_line_break()
@writer.send_flowing_data("beobachtet. Deshalb sollte Valcyte nur gleichzeitig mit Imipenem-Cilastatin gegeben werden, wenn")
@writer.send_line_break()
@writer.send_flowing_data("der potenzielle Nutzen die potenziellen Risiken \374berwiegt (siehe \253Interaktionen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Sowohl Zidovudin als auch Valcyte k\366nnen eine Neutropenie und An\344mie verursachen. Manche")
@writer.send_line_break()
@writer.send_flowing_data("Patienten vertragen unter Umst\344nden keine gleichzeitige volldosierte Therapie mit diesen beiden")
@writer.send_line_break()
@writer.send_flowing_data("Arzneimitteln (siehe \253Interaktionen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Da die Plasmakonzentrationen von Didanosin w\344hrend einer Begleittherapie mit Valcyte ansteigen")
@writer.send_line_break()
@writer.send_flowing_data("k\366nnen, m\374ssen die Patienten engmaschig auf toxische Wirkungen von Didanosin \374berwacht werden")
@writer.send_line_break()
@writer.send_flowing_data("(siehe \253Interaktionen\273).")
@writer.send_line_break()
@writer.send_flowing_data("Eine gleichzeitige Behandlung mit Valcyte und Arzneimitteln, die als myelosuppressiv bekannt sind")
@writer.send_line_break()
@writer.send_flowing_data("oder die Nierenfunktion beeintr\344chtigen k\366nnen, kann zu verst\344rkten toxischen Wirkungen f\374hren")
@writer.send_line_break()
@writer.send_flowing_data("(siehe \253Interaktionen\273).")
@writer.send_line_break()
@writer.send_flowing_data("In die kontrollierte klinische Studie mit Valganciclovir zur Prophylaxe der CMV-Erkrankung nach")
@writer.send_line_break()
@writer.send_flowing_data("Organtransplantation (siehe \253Eigenschaften/Wirkungen, Klinische Wirksamkeit\273), waren keine")
@writer.send_line_break()
@writer.send_flowing_data("Patienten nach Lungentransplantation eingeschlossen. Die Erfahrungen in diesen Patientengruppen")
@writer.send_line_break()
@writer.send_flowing_data("sind deshalb begrenzt.")
@writer.send_line_break()
@writer.send_flowing_data("Bei Anwendung von Valcyte und/oder Ganciclovir wurden Krampfanf\344lle, Sedierung, Schwindel,")
@writer.send_line_break()
@writer.send_flowing_data("Ataxie und/oder Verwirrtheit angegeben. Solche Wirkungen beeintr\344chtigen Aufgaben, die")
@writer.send_line_break()
@writer.send_flowing_data("Aufmerksamkeit erfordern, darunter auch die Verkehrst\374chtigkeit des Patienten und das Bedienen")
@writer.send_line_break()
@writer.send_flowing_data("von Maschinen (siehe \253Wirkung auf die Fahrt\374chtigkeit und auf das Bedienen von Maschinen\273).")
