@writer.send_flowing_data("Die Plasmakonzentrationen von Didanosin waren bei Verabreichung mit Ganciclovir (sowohl")
@writer.send_line_break()
@writer.send_flowing_data("intraven\366s als auch oral) durchg\344ngig erh\366ht. Bei oralen Dosen Ganciclovir von 3 und 6 g/Tag wurde")
@writer.send_line_break()
@writer.send_flowing_data("ein Anstieg der AUC von Didanosin um 84 bis 124% beobachtet, ebenso wurde bei intraven\366sen")
@writer.send_line_break()
@writer.send_flowing_data("Dosen von 5 und 10 mg/kg/Tag ein Anstieg der AUC von Didanosin um 38 bis 67% beobachtet.")
@writer.send_line_break()
@writer.send_flowing_data("Dieser Anstieg l\344sst sich nicht mit einem kompetitiven Mechanismus um die renal-tubul\344re Exkretion")
@writer.send_line_break()
@writer.send_flowing_data("erkl\344ren, da es zu einem Anstieg der prozentual ausgeschiedenen Didanosindosis kam. Dieser")
@writer.send_line_break()
@writer.send_flowing_data("Anstieg k\366nnte entweder auf eine erh\366hte Bioverf\374gbarkeit oder einen verminderten Metabolismus")
@writer.send_line_break()
@writer.send_flowing_data("zur\374ckgef\374hrt werden. Es fand sich kein klinisch signifikanter Effekt auf die Ganciclovir-")
@writer.send_line_break()
@writer.send_flowing_data("Konzentrationen. Jedoch sollten die Patienten wegen des Anstiegs der Plasmakonzentrationen von")
@writer.send_line_break()
@writer.send_flowing_data("Didanosin in Anwesenheit von Ganciclovir engmaschig auf toxische Wirkungen von Didanosin")
