@writer.new_font(font)
@writer.send_line_break()
@writer.send_flowing_data("Aufgrund der Ergebnisse einer Studie mit Einmalverabreichung der empfohlenen Dosierung von")
@writer.send_line_break()
@writer.send_flowing_data("oralem Mycophenolat-Mofetil (MMF) und i.v. Ganciclovir und wegen der bekannten Wirkungen einer")
@writer.send_line_break()
@writer.send_flowing_data("Nierenfunktionsst\366rung auf die Pharmakokinetik von MMF und Ganciclovir ist zu erwarten, dass die")
@writer.send_line_break()
@writer.send_flowing_data("gleichzeitige Verabreichung dieser Substanzen (die um die renal-tubul\344re Sekretion konkurrieren")
@writer.send_line_break()
@writer.send_flowing_data("k\366nnen) zu einem Anstieg des phenolischen Glucuronids von Mycophenols\344ure (MPAG) und der")
@writer.send_line_break()
@writer.send_flowing_data("Ganciclovir-Konzentration f\374hren kann. Es ist keine erhebliche Ver\344nderung der Pharmakokinetik")
@writer.send_line_break()
@writer.send_flowing_data("von Mycophenols\344ure (MPA) zu erwarten und eine Anpassung der MMF-Dosis ist nicht erforderlich.")
@writer.send_line_break()
@writer.send_flowing_data("Bei Patienten mit eingeschr\344nkter Nierenfunktion, die gleichzeitig MMF und Ganciclovir erhalten, sind")
@writer.send_line_break()
@writer.send_flowing_data("die Dosierungsempfehlungen f\374r Ganciclovir zu beachten und die Patienten m\374ssen sorgf\344ltig")
@writer.send_line_break()
@writer.send_flowing_data("\374berwacht werden. Da sowohl Mycophenolat-Mofetil als auch Ganciclovir zu Neutropenie und")
@writer.send_line_break()
@writer.send_flowing_data("Leukopenie f\374hren k\366nnen, sollten die Patienten auf verst\344rkt auftretende Nebenwirkungen")
@writer.send_line_break()
@writer.send_flowing_data("\374berwacht werden.")
