@writer.send_flowing_data("Hydroxyharnstoff).")
@writer.send_line_break()
@writer.send_flowing_data("Da Ganciclovir \374ber die Nieren ausgeschieden wird (siehe \253Pharmakokinetik\273), kann die Toxizit\344t")
@writer.send_line_break()
@writer.send_flowing_data("auch verst\344rkt werden, wenn Valcyte gleichzeitig mit Arzneimitteln verabreicht wird, die die renale")
@writer.send_line_break()
@writer.send_flowing_data("Clearance von Ganciclovir verringern und damit dessen Konzentration im K\366rper erh\366hen k\366nnten.")
@writer.send_line_break()
@writer.send_flowing_data("Die renale Clearance von Ganciclovir k\366nnte durch zwei Mechanismen gehemmt werden: (a) durch")
@writer.send_line_break()
@writer.send_flowing_data("Nephrotoxizit\344t, verursacht durch Wirkstoffe wie z.B. Cidofovir und Foscarnet, und (b) durch")
@writer.send_line_break()
@writer.send_flowing_data("kompetitive Hemmung der aktiven tubul\344ren Sekretion in der Niere, verursacht z. B. durch andere")
@writer.send_line_break()
@writer.send_flowing_data("Nukleosidanaloga.")
@writer.send_line_break()
@writer.send_flowing_data("Diese Arzneimittel sollten daher nur gleichzeitig mit Ganciclovir angewendet werden, wenn der")
@writer.send_line_break()
@writer.send_flowing_data("m\366gliche Nutzen die potentiellen Risiken \374bersteigt (siehe \253Warnhinweise und")
@writer.send_line_break()
