@writer.send_line_break()
@writer.send_flowing_data("Phosphorylierung von Ganciclovir bevorzugt in virusinfizierten Zellen.")
@writer.send_line_break()
@writer.send_flowing_data("Die virostatische Aktivit\344t von Ganciclovir ist durch die Hemmung der viralen DNA-Synthese durch")
@writer.send_line_break()
@writer.send_flowing_data("zwei Mechanismen bedingt:")
