@writer.send_line_break()
@writer.send_flowing_data("Klinische Studien mit Valcyte wurden bei Patienten mit Aids und CMV-Retinitis durchgef\374hrt. Valcyte")
@writer.send_line_break()
@writer.send_flowing_data("hat sich zur Induktionstherapie bei CMV-Retinitis als vergleichbar wirksam wie intraven\366ses")
@writer.send_line_break()
@writer.send_flowing_data("Ganciclovir erwiesen. In einer offenen randomisierten und kontrollierten Studie wurden 160 Patienten")
@writer.send_line_break()
@writer.send_flowing_data("mit Aids und neu diagnostizierter CMV-Retinitis nach einem Randomisierungsschema entweder einer")
@writer.send_line_break()
@writer.send_flowing_data("Therapie mit Valcyte Tabletten (zweimal t\344glich 900 mg w\344hrend 21 Tagen, anschliessend einmal")
@writer.send_line_break()
@writer.send_flowing_data("t\344glich 900 mg w\344hrend 7 Tagen) oder mit intraven\366s verabreichter L\366sung von Ganciclovir (zweimal")
@writer.send_line_break()
@writer.send_flowing_data("t\344glich 5 mg/kg w\344hrend 21 Tagen, gefolgt von einmal t\344glich 5 mg/kg w\344hrend 7 Tagen) zugef\374hrt.")
@writer.send_line_break()
@writer.send_flowing_data("Die medianen Werte betrugen f\374r das Alter 39 Jahre, f\374r den Ausgangswert der HIV-1-RNA 4,9 log10")
@writer.send_line_break()
@writer.send_flowing_data("und f\374r die CD4-Zellzahl 23 Zellen/mm\263. Die Bestimmung der Progression der CMV-Retinitis mittels")
@writer.send_line_break()
@writer.send_flowing_data("anonymer \334berpr\374fung von Netzhautaufnahmen, die bei der Erhebung der Ausgangswerte sowie in")
@writer.send_line_break()
@writer.send_flowing_data("der vierten Woche angefertigt worden waren, stellte das prim\344re Beurteilungskriterium f\374r die")
@writer.send_line_break()
@writer.send_flowing_data("dreiw\366chige Induktionstherapie dar. In Tabelle 4 sind die Resultate nach vier Wochen aufgef\374hrt.")
@writer.send_line_break()
@writer.send_paragraph()
@writer.send_flowing_data("Seite 14")
@writer.send_page()
